import { BrowserRouter,Routes , Route } from "react-router-dom";
import NodebtBrn from "./nodebtBrn";
import Nodebtlist from "./nodebt_list";
import AppHeader from "./AppHeader";
import Auth from "./auth";
import { useEffect } from "react";
//import AppRouter from "./AppRouter";
function Main() {
  useEffect( ()=>{
    //sessionStorage.setItem("pwaUser",1234)
    sessionStorage.removeItem("PWAusr");
  });

  if(!sessionStorage.getItem("PWAusr")){
    return(
      <div>
        <Auth/>
      </div>
    );
  }else{
    return (
      <div>
            <AppHeader />
            <BrowserRouter basename={'/nodebt'}>
                  <Routes>
                      <Route path="/" element={<Nodebtlist/>}></Route>
                      <Route path="/nodebtlist" element={<Nodebtlist/>}></Route>
                      <Route path="/nodebtBrn" element={<NodebtBrn/>}></Route>
                  </Routes>
              </BrowserRouter>
      </div>
    );
  }
}

export default Main;
